import { Box, SimpleGrid, Image } from "@chakra-ui/react";
import React from "react";
import { useQuery, QueryCache } from "react-query";

export default function Images() {

   var data = useQuery("images", () =>
    fetch("http://localhost:3002/images").then((res) => {
      console.log("res");
 
      return res.json();
    })
  );

  console.log("here");
  if (data.isLoading) return <Box>Loading...</Box>;
  console.log("data", data);
  console.log("data 1", `'${data.data[0].signedUrl[0]}'`);
  return (
    <SimpleGrid minChildWidth="200px" spacing="40px" mt="20">
        {data.forEach((element: any) => {
            return(<Image src={`${element.signedUrl[0]}`}></Image> )
        })}
      
      <Box bg="#9CA3DB" height="200px" width="200px"></Box>
      <Box bg="#9CA3DB" height="200px" width="200px"></Box>
      <Box bg="#9CA3DB" height="200px" width="200px"></Box>
      <Box bg="#9CA3DB" height="200px" width="200px"></Box>
      <Box bg="#9CA3DB" height="200px" width="200px"></Box>
    </SimpleGrid>
  );
}
